import { Typography } from "@material-ui/core";
import React from "react";
import slider1 from "../assests/slider1.jpg";

function SectionA(props) {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div style={{ width: "50%" }}>
        <Typography>LET'S CHANGE HOW AND WHY YOU WORK</Typography>
      </div>
      <div style={{ width: "50%" }}>
        <img src={slider1} height="500px" width="500px" alt="" />
      </div>
    </div>
  );
}

export default SectionA;
